class CreateAssetReportModelClass {  String? assetId;  String? date;  String? latitude;  String? longitude;  String? reportType;  List<Null>? attachments;  String? assignedTo;  List<ReasonFields>? reasonFields;  List<SystemFields>? systemFields;  String? sId;  String? createdAt;  String? updatedAt;  int? iV;  CreateAssetReportModelClass(      {this.assetId,        this.date,        this.latitude,        this.longitude,        this.reportType,        this.attachments,        this.assignedTo,        this.reasonFields,        this.systemFields,        this.sId,        this.createdAt,        this.updatedAt,        this.iV});  CreateAssetReportModelClass.fromJson(Map<String, dynamic> json) {    assetId = json['assetId'];    date = json['date'];    latitude = json['latitude'];    longitude = json['longitude'];    reportType = json['reportType'];    // if (json['attachments'] != null) {    //   attachments = <Null>[];    //   json['attachments'].forEach((v) {    //     attachments!.add(new Null.fromJson(v));    //   });    // }    assignedTo = json['assignedTo'];    if (json['reasonFields'] != null) {      reasonFields = <ReasonFields>[];      json['reasonFields'].forEach((v) {        reasonFields!.add(new ReasonFields.fromJson(v));      });    }    if (json['systemFields'] != null) {      systemFields = <SystemFields>[];      json['systemFields'].forEach((v) {        systemFields!.add(new SystemFields.fromJson(v));      });    }    sId = json['_id'];    createdAt = json['createdAt'];    updatedAt = json['updatedAt'];    iV = json['__v'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['assetId'] = this.assetId;    data['date'] = this.date;    data['latitude'] = this.latitude;    data['longitude'] = this.longitude;    data['reportType'] = this.reportType;    // if (this.attachments != null) {    //   data['attachments'] = this.attachments!.map((v) => v.toJson()).toList();    // }    data['assignedTo'] = this.assignedTo;    if (this.reasonFields != null) {      data['reasonFields'] = this.reasonFields!.map((v) => v.toJson()).toList();    }    if (this.systemFields != null) {      data['systemFields'] = this.systemFields!.map((v) => v.toJson()).toList();    }    data['_id'] = this.sId;    data['createdAt'] = this.createdAt;    data['updatedAt'] = this.updatedAt;    data['__v'] = this.iV;    return data;  }}class ReasonFields {  String? name;  String? value;  String? sId;  ReasonFields({this.name, this.value, this.sId});  ReasonFields.fromJson(Map<String, dynamic> json) {    name = json['name'];    value = json['value'];    sId = json['_id'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['name'] = this.name;    data['value'] = this.value;    data['_id'] = this.sId;    return data;  }}class SystemFields {  String? collection;  Values? values;  SystemFields({this.collection, this.values});  SystemFields.fromJson(Map<String, dynamic> json) {    collection = json['collection'];    values =    json['values'] != null ? new Values.fromJson(json['values']) : null;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['collection'] = this.collection;    if (this.values != null) {      data['values'] = this.values!.toJson();    }    return data;  }}class Values {  String? assetId;  String? assetName;  String? assetCode;  String? assetType;  String? partnerId;  String? partnerName;  String? partnerCategory;  String? city;  int? pincode;  Values(      {this.assetId,        this.assetName,        this.assetCode,        this.assetType,        this.partnerId,        this.partnerName,        this.partnerCategory,        this.city,        this.pincode});  Values.fromJson(Map<String, dynamic> json) {    assetId = json['assetId'];    assetName = json['assetName'];    assetCode = json['assetCode'];    assetType = json['assetType'];    partnerId = json['partnerId'];    partnerName = json['partnerName'];    partnerCategory = json['partnerCategory'];    city = json['city'];    pincode = json['pincode'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['assetId'] = this.assetId;    data['assetName'] = this.assetName;    data['assetCode'] = this.assetCode;    data['assetType'] = this.assetType;    data['partnerId'] = this.partnerId;    data['partnerName'] = this.partnerName;    data['partnerCategory'] = this.partnerCategory;    data['city'] = this.city;    data['pincode'] = this.pincode;    return data;  }}